    parecer:
      'VERIFICAÇÃO DOS NOMES DOS ALUNOS VERSUS A PAUTA DE FREQUÊNCIA / LOGÍSTICA INTERNACIONAL (2017.1) - PROFA. INGRID KLEIN \n\nDE FATO, TENHO DUAS DIVERGÊNCIAS (QUE ACREDITO QUE SEJAM FUTURAS EXCLUSÕES NA DISCIPLINA DE LOGÍSTICA INTERNACIONAL - 2017.1) E SÃO ELAS:\n\n1) BRUNO KIUVER SOUZA DE MACEDO -\u003e CONVERSEI COM O ALUNO QUE ME DISSE QUE TEM UMA DISCIPLINA PREGRESSA EM QUE ESTARIA REPROVADO E NÃO PODERIA FAZER LOGÍSTICA E A PRIORI ESTARIA FAZENDO MKT. INTERNACIONAL POR RECOMENDAÇÃO DA COORDENAÇÃO DO CURSO, MAS QUE AINDA VERIFICARIA COM A COORDENAÇÃO OS DETALHES FINAIS PARA ENTÃO DECIDIR SE FICARIA OU NÃO NA DISCIPLINA.\n2) LUCAS RIBEIRO LEITÃO -\u003e NÃO ESTAVA INCLUÍDO NA PAUTA ATÉ 02.03.2017, MAS SE APRESENTOU NA AULA EM 07.03.2017 E VERIFIQUEI QUE NA PAUTA ELE JÁ ESTÁ INCLUÍDO. ENTRETANTO, ONTEM APÓS ASSISTIR MAIS DE DUAS HORAS DE AULA, O ALUNO DISSE QUE TERIA VERIFICADO EM DETALHES E QUE ELE TERIA DE ESTAR EM MARKETING INTERNACIONAL E FOI ASSISTIR O FINAL DE AULA LÁ.\n\nSITUAÇÃO RESOLVIDA PELA COORDENAÇÃO DO CURSO E ALUNOS JÁ ESTÃO INCLUÍDOS NAS DISCIPLINAS PERTINENTES. \n',
    observacao:
      '\nSITUAÇÃO RESOLVIDA PELA COORDENAÇÃO DO CURSO E ALUNOS JÁ ESTÃO INCLUÍDOS NAS DISCIPLINAS PERTINENTES. \n',
